script: |
  super -f text -I q11298.spq | sort > q11298.out

inputs:
  - name: q11298.spq
    data: |
      SELECT ALL + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col2 * - - col0 * col2 BETWEEN - col0 - + col2 + - - col0 / col2 AND + col2;
  - name: tab2

outputs:
  - name: q11298.out
    data: |
